var CalibrateController = function () {
  var x  = 0,
      y = 0,
      w = 1000,
      h = 1000,
      cx = 0,
      cy = 0,
      lx,
      ly,
      drag = false,
      zi = false,
      zo = false,
      as=1,
      cvs,
      aspShift = false,
      isInitalized = false
  ;

function dbg(){
  console.log("x: "+x);
  console.log("y: "+y);
  console.log("w: "+w);
  console.log("h: "+h);
  console.log("cx: "+cx);
  console.log("cy: "+cy);
  console.log("lx: "+lx);
  console.log("ly: "+ly);
}

function zoomIn  (_shift) {
  var shift = _shift | 10;
  w -= shift;
  h -= shift*as;
  validateWH();
  update();
}

function zoomOut  (_shift) {
  var shift = _shift | 10;
  w += shift;
  h += shift*as;
  validateWH();
  update();
}

function changeAspectRatio (_shift){
  w += _shift;
  validateWH();
  update();
  updateXYFromWH();
}


function changeRegionCB(_w,_h){
 return function(){
  w += _w;
  h += _h;
  validateWH();
  update();
  updateXYFromWH();
 }
}

function moveRegionCB(_dx,_dy){
  return function(){
    moveRelatively(_dx,_dy);
  }
}



function validateWH(){
  if(w < 2)w = 2;
  if(h < 2)h = 2;
}

function moveRelatively(dx,dy){
  cx -= dx;
  cy += dy;
  update();
}

function loadFromViewConfig(){
  var conf = ViewConfig.conf();
  x = conf.x || 0;
  y = conf.y || 0;
  w = conf.w || 1000;
  h = conf.h || 1000;
  validateWH();
}

function init (){
  cvs = document.getElementById('cvs');
  setInterval(function(){
      if(zi)zoomIn();
      if(zo)zoomOut();
  },50);
  lx = cvs.clientWidth;
  ly = cvs.clientHeight;
  loadFromViewConfig();
  updateXYFromWH();
  update();
}

function toggleAspectShiftMode(){
  aspShift = !aspShift;
}

function addMouseEvent (){
  if(Fabnavi.isCalibrationLocked()){
    removeMouseEvent();
    return -1;
  }

  /*
  cvs.onwheel = function(e){
    e.preventDefault();
    var y = e.deltaY;
    if(y>0)zoomOut(y);
    else zoomIn(-y);
  };
  */
  cvs.onmousedown = function (e) {
    drag = true;
    lx = e.clientX;
    ly = e.clientY;
  };
  cvs.onmouseup = function (e){
    drag = false;
  };
  cvs.onmousemove= function (e){
    if(drag){
      var eX = e.clientX;
      if(aspShift){
        changeAspectRatio(lx - eX);
        lx = eX;
      }else {
        var eY = e.clientY;
        moveRelatively(lx - eX,eY - ly);
        lx =  eX;
        ly =  eY;
      }
    }
  };
}

function removeMouseEvent (){
  cvs.onwheel = "";
  cvs.onmousedown = "";
  cvs.onmouseup = "";
  cvs.onmousemove= "";
}

function updateXYFromWH  () {
  as = h/w;
  cx = Math.floor(w/2) + Number(x);
  cy = Math.floor(h/2) + Number(y);
}

function updateXYFromCenter (){
  x = cx - Math.floor(w/2);
  y = cy - Math.floor(h/2);
}

function update (){
  updateXYFromCenter();
  if(isInitalized)ViewConfig.setConf({x:x,y:y,w:w,h:h});
  else {
   initConf();
  }
  Fabnavi.redraw();
}

function initConf(){
    var c = "";
    if(c = MainView.getCurrentImage()){
      w = c.naturalWidth;
      h = c.naturalHeight;
      isInitalized = true;
     }
}

return {
  init:init,
  addMouseEvent:addMouseEvent,
  removeMouseEvent:removeMouseEvent,
  toggleAspBtn:toggleAspectShiftMode,
  changeRegionCB:changeRegionCB,
  moveRegionCB:moveRegionCB,
  dbg:dbg,
  update:update,
};
} ();

var Camera = function() {
  var connected = false,
      heartbeat = null;

  function init () {
    if(document.sonycameracontroller == undefined){
      alert("Addon is not  installed");
      window.open("https://github.com/hrl7/SonyCameraRemoteControllerAddon/blob/master/addon/sonycameraremotecontroller.xpi?raw=true");
      return false;
    }
    document.sonycameracontroller.setup({ipaddress: "10.0.0.1", port: 10000, version: "1.0"},false,true);

    heartbeat = window.setInterval(function(){
        ping();
    },5000);
    return true;
  }

  function zoomOnce(){
    var d = $.Deferred();
    document.sonycameracontroller.zoomIn(function(res){
        setTimeout(function(){
            d.resolve();
        },700);
    });
    return d.promise();
  }

  function shoot () {
    var d = $.Deferred();
    var t = window.setTimeout(function(){
        d.reject("Camera Not Respond");        
    },3000);
    var listener = 
    function (url,res) {
      window.clearTimeout(t);
      setTimeout(function(){
        d.resolve(url);
     },100);
    };
    document.sonycameracontroller.take(listener);

    return d.promise();
  }

  function ping(){
    var d = $.Deferred();
    try{
      var r = new XMLHttpRequest();
      var t = window.setTimeout(function(){
          r.abort();
          connected = false;
          d.reject(false);
      },2000);
      r.onload = function(e){
        window.clearTimeout(t);
        connected = true;
        d.resolve(true);
      };
      r.open("GET","http://10.0.0.1:10000",true);
      r.send();
    } catch(e){
    }
    return d.promise();
  }

  return {
    init:init,
    shoot:shoot,
    ping:ping,
  };
  }();
/* firefox specific */


function genKeyMapIndex(){
  var keyMap = KeyBind.keyMap();
  var i,keyCode;
  var result = "";
  for(keyCode in keyMap){
    var keyName;
    for(i in KeyEvent){
     if(keyCode == KeyEvent[i])keyName = i.toString().replace("DOM_VK_","");
    }
    result += keyName + " : " + keyMap[keyCode].name + "\n";
  }
  return result;
}

function getAllKeyMapIndex(){
  var keyMapIndex = "";
  if(KeyBind.mode == "Index"){
    KeyBind.init();
    keyMapIndex += genKeyMapIndex();
  }else if(KeyBind.mode == "Project"){
    KeyBind.play();
    keyMapIndex += "Play Mode --------- \n";
    keyMapIndex += genKeyMapIndex();
    KeyBind.add();
    keyMapIndex += "\n\nAdd Mode ----------\n";
    keyMapIndex += genKeyMapIndex();
    KeyBind.edit();
    keyMapIndex += "\n\nEdit Mode ---------\n";
    keyMapIndex += genKeyMapIndex();
  }else {
    throw Error("Invalid KeyMap");
  }
  console.log(keyMapIndex);
}
